// Track progress - change this value to process different batches
// 0 = first 500, 1 = next 500 (500-1000), 2 = next 500 (1000-1500), etc.
const BATCH_NUMBER = 33

module.exports = async ({ db }) => {
  const BATCH_SIZE = 500
  const skipCount = BATCH_NUMBER * BATCH_SIZE

  console.log(`\n🚀 Processing batch ${BATCH_NUMBER + 1}`)
  console.log(`   Range: ${skipCount} to ${skipCount + BATCH_SIZE}\n`)

  const ordersRef = db.collection('completed')

  // Get orders with offset and limit
  const ordersSnapshot = await ordersRef
    .orderBy('timestampCreated')
    .offset(skipCount)
    .limit(BATCH_SIZE)
    .get()

  console.log(`📊 Fetched ${ordersSnapshot.size} orders\n`)

  // Create a Set of all valid ItemIds from ALL_PRODUCTS
  const validItemIds = new Set(ALL_PRODUCTS.map((product) => product.ItemId))

  // Create a Map for quick lookup by Name (case-insensitive)
  const productsByName = new Map()
  ALL_PRODUCTS.forEach((product) => {
    const normalizedName = product.Name?.trim().toUpperCase()
    if (normalizedName) {
      productsByName.set(normalizedName, product)
    }
  })

  console.log(`🔄 Starting to update orders with matched items...\n`)

  let updatedOrdersCount = 0
  let updatedItemsCount = 0

  for (const doc of ordersSnapshot.docs) {
    const order = doc.data()
    const items = order.items || []
    let hasUpdates = false

    const updatedItems = items.map((item) => {
      // If ItemId is invalid, try to find by Name
      if (!validItemIds.has(item.ItemId)) {
        const normalizedItemName = item.Name?.trim().toUpperCase()

        if (normalizedItemName && productsByName.has(normalizedItemName)) {
          const matchedProduct = productsByName.get(normalizedItemName)
          console.log(
            `✅ Updating: "${item.Name}" | Old ID: ${item.ItemId} → New ID: ${matchedProduct.ItemId}`
          )

          updatedItemsCount++
          hasUpdates = true

          // Return updated item with new ItemId
          return {
            ...item,
            ItemId: matchedProduct.ItemId,
          }
        }
      }

      return item
    })

    // Update the order if there were changes
    if (hasUpdates) {
      await ordersRef.doc(doc.id).update({ items: updatedItems })
      updatedOrdersCount++
      console.log(
        `📝 Updated order: ${
          order.orderId ?? order?.timestampCreated?.seconds
        }\n`
      )
    }
  }

  // Final summary
  console.log(`\n✨ BATCH ${BATCH_NUMBER + 1} COMPLETE:`)
  console.log(`Orders checked: ${ordersSnapshot.size}`)
  console.log(`Orders updated: ${updatedOrdersCount}`)
  console.log(`Items updated: ${updatedItemsCount}`)
  console.log(
    `\n💡 To process next batch, change BATCH_NUMBER to ${
      BATCH_NUMBER + 1
    } and rerun\n`
  )

  // Export update summary
  const updateSummary = {
    timestamp: new Date().toISOString(),
    batchNumber: BATCH_NUMBER + 1,
    range: `${skipCount}-${skipCount + BATCH_SIZE}`,
    summary: {
      ordersChecked: ordersSnapshot.size,
      ordersUpdated: updatedOrdersCount,
      itemsUpdated: updatedItemsCount,
    },
  }

  console.log({ updateSummary })
  // const summaryFilePath = path.join(__dirname, '../orders-update-summary.json')
  // await fs.writeFile(
  //   summaryFilePath,
  //   JSON.stringify(updateSummary, null, 2),
  //   'utf8'
  // )
  // console.log(`📄 Update summary exported to: ${summaryFilePath}`)
  console.log('DONE')
}
